import React, {Component} from 'react'


class Profil extends Component{


  
    render(){
      return(
        <div>
          <img src={this.props.imgSrc} alt='logo'/>
          <h1>{this.props.FullName}</h1>
          <h1>{this.props.bio}</h1>
          <h1>{this.props.profession}</h1>
        </div>
      )
      
    }
  }

export default Profil
